package com.leadmaster.common.domain;import javax.persistence.Column;import javax.persistence.Entity;import javax.persistence.Table;@Entity@Table(name = "chat_history")public class ChatHistory extends AbstractEntity {	private static final long serialVersionUID = -8924261433695968011L;	@Column(name = "sender_id")	private Long senderId;	@Column(name = "receiver_id")	private Long receiverId;	@Column(name = "text")	private String text;	@Column(name = "read_status")	private String readStatus;	@Column(name = "status")	private String status;	@Column(name = "created_date")	private String createdDate;	@Column(name = "created_by")	private Long createdBy;	@Column(name = "updated_date")	private String updatedDate;	@Column(name = "updated_by")	private Long updatedBy;	public Long getSenderId() {		return senderId;	}	public void setSenderId(Long senderId) {		this.senderId = senderId;	}	public Long getReceiverId() {		return receiverId;	}	public void setReceiverId(Long receiverId) {		this.receiverId = receiverId;	}	public String getText() {		return text;	}	public void setText(String text) {		this.text = text;	}	public String getReadStatus() {		return readStatus;	}	public void setReadStatus(String readStatus) {		this.readStatus = readStatus;	}	public String getStatus() {		return status;	}	public void setStatus(String status) {		this.status = status;	}	public String getCreatedDate() {		return createdDate;	}	public void setCreatedDate(String createdDate) {		this.createdDate = createdDate;	}	public Long getCreatedBy() {		return createdBy;	}	public void setCreatedBy(Long createdBy) {		this.createdBy = createdBy;	}	public String getUpdatedDate() {		return updatedDate;	}	public void setUpdatedDate(String updatedDate) {		this.updatedDate = updatedDate;	}	public Long getUpdatedBy() {		return updatedBy;	}	public void setUpdatedBy(Long updatedBy) {		this.updatedBy = updatedBy;	}}